<script>
	var Modal2;//最大化窗口 添加按钮
    var Modal3;//Modal嵌入页签页
    var tab1;
	var form1;//表单
	$(document).ready(function () {
        
	});
	function SvgBig(){
		// var divsvg=document.getElementById('divSvg');
		// divsvg.style.width=parseInt(divsvg.clientWidth)+10+"px";
		// divsvg.style.height=parseInt(divsvg.clientHeight)+10+"px";
		var svg = document.getElementById('svg');
		svg.setAttribute('width', parseInt(svg.width.animVal.valueAsString)+1000);
		svg.setAttribute('height', parseInt(svg.height.animVal.valueAsString)+300);
		//svg.setAttribute('viewBox',"0 0 "+ (parseInt(svg.viewBox.animVal.width)+500)+" "+(parseInt(svg.viewBox.animVal.height)+200)+" ");
	}
	function SvgSmall(){
		var svg = document.getElementById('svg');
		if(parseInt(svg.width.animVal.valueAsString)-1000<0||parseInt(svg.height.animVal.valueAsString)-300<0){
			swal('已经最小了!');
		}else{
			svg.setAttribute('width', parseInt(svg.width.animVal.valueAsString)-1000);
			svg.setAttribute('height', parseInt(svg.height.animVal.valueAsString)-300);
		}
	}
	function changeColor(evt) 
	{ 
		var length=evt.currentTarget.children.length;
		var param={title:"",desc:'',station:'安康'};
		for(var i=0;i<length;i++){
			if(evt.currentTarget.children[i].toString()=="[object SVGTitleElement]"){
				param.title=evt.currentTarget.children[i].innerHTML;
			}
			if(evt.currentTarget.children[i].toString()=="[object SVGDescElement]"){
				param.desc=evt.currentTarget.children[i].innerHTML;
			}
		}
		if(param.desc!=""){
			// <!-- swal(JSON.stringify(param));	 -->
			$.ajax({
		        type:"POST",
		        url:"http://localhost:54942/api/equipment",
		        dataType:"json", 
				contentType:"application/json", 
				data: JSON.stringify(param),
		        success:function(data){
		           if(data.Result){
					   InitModal2(param.title,data.Data);
		               Modal2.show();
		           }else{
		              swal(data.Msg);
		           }
		        },
		        error:function(jqXHR){
		          swal("发生错误："+ jqXHR.status);
		        }
			});
			// <!-- Modal2.show(); -->
		}
	}
	//最大化窗口 添加按钮
    function InitModal2(title,data) {
        $(document.body).append('<div id="modal2"></div>');
        Modal2 = new Modal();
		Modal2.title=title;
        Modal2.btns = [{ id: "btn_save", text: "编辑" }, { id: "closebtn" }]
        Modal2.InitMax = false;//是否最大化
        Modal2.renderto = "#modal2";//绘制到div	
		var html='<form>';
			html+='<div class="form-group" style="display:none;">Id：<input id="Id" type="text" class="form-control" readonly="readonly" value="'+data.Id+'"></div>';
			html+='<div class="form-group">名称：<input id="DeviceName" type="text" class="form-control" readonly="readonly" value="'+data.DeviceName+'"></div>';
			html+='<div class="form-group">本线限界：<input id="LineLimit" type="text" class="form-control" readonly="readonly" value="'+data.LineLimit+'"></div>';
			html+='<div class="form-group">邻线限界：<input id="AdjacentLimit" type="text" class="form-control" readonly="readonly" value="'+data.AdjacentLimit+'"></div>';
			html+='<div class="form-group">透镜组类型：<input id="LensGroupType" type="text" class="form-control" readonly="readonly" value="'+data.LensGroupType+'"></div>';
			html+='<div class="form-group">表示器个数：<input id="NumberIndicators" type="text" class="form-control" readonly="readonly" value="'+data.NumberIndicators+'"></div>';
			html+='<div class="form-group">机构类型：<input id="InstitutionalType" type="text" class="form-control" readonly="readonly" value="'+data.InstitutionalType+'"></div>';
			html+='<div class="form-group">器材型号：<input id="EquipmentModel" type="text" class="form-control" readonly="readonly" value="'+data.EquipmentModel+'"></div>';
			html+='</form>';
        Modal2.body = html;//内容
        Modal2.OnfirstInited = function () {//绘制完成后事件
            $("#btn_save").click(function (event) {
                if(event.currentTarget.innerText=="编辑"){
					event.currentTarget.innerText="确定";
					$("form input").not("#DeviceName").removeAttr("readonly");
				}else{
					var param={Id:$("#Id").val(),LineLimit:$("#LineLimit").val(),AdjacentLimit:$("#AdjacentLimit").val(),LensGroupType:$("#LensGroupType").val(),NumberIndicators:$("#NumberIndicators").val(),InstitutionalType:$("#InstitutionalType").val(),EquipmentModel:$("#EquipmentModel").val()};
					$.ajax({
				        type:"PUT",
				        url:"http://localhost:54942/api/equipment",
				        dataType:"json", 
						contentType:"application/json", 
						data: JSON.stringify(param),
				        success:function(data){
				           if(data.Result){
							  swal(data.Msg);
				           }else{
				              swal(data.Msg);
				           }
				        },
				        error:function(jqXHR){
				          swal("发生错误："+ jqXHR.status);
				        }
					});
					Modal2.hide();
				}
            })
        };
    }
	//Modal嵌入页签页
    function InitModal3() {
        $(document.body).append('<div id="modal3"></div>');
        Modal3 = new Modal();
        Modal3.renderto = "#modal3";
